import clarkson from '../../Pictures/clarkson-meme.gif';
import Confetti from 'react-confetti';
import React, { useState } from "react";

import "./PageNotFound.css";

export default function PageNotFound() {
    const [num, setNum] = useState(0);

    const RandVal = (max, min) => { return Math.random() * (max - min + 1) + min; }

    const UpdateImage = () => { setNum(Math.floor(RandVal(25, 5))) }

  //   const handleClick = () => { 
  //     setNum(randomNumberInRange(1, 20)); 
  // };

    return (
      <div className='screen-format'>
        <h1> 404 - Not Found! </h1>
        <img className='image-style, pop-out' src={clarkson} alt="clarckson-meme" />
        <Confetti />
        <h1> You've entered an invalid path! <br/> Et tu brute?!!! Fix it! </h1>
        <p> Number is: {num}  </p>
        <button onClick={UpdateImage}> Click </button>
        <br/>
        <br/>
      </div>
    )
  }
